// src/components/StoreList.js (Pseudo-updated version)
import React from 'react';

const StoreList = ({ stores, onSelectStore }) => {
  // Logic to render list of stores and handle selection
  return stores.map(store => (
    <div key={store.id} onClick={() => onSelectStore(store)}>
      {store.name}
    </div>
  ));
};

export default StoreList;
